### Solution 1:

I'm not sure if this is exactly what you're looking for, but I've created a custom `UIView` that can be used to stack multiple `UIImageView`s on top of each other.

```
class StackedImageView: UIView {

    var images: [UIImage] = [] {
        didSet {
            for imageView in imageViews {
                imageView.removeFromSuperview()
            }
            imageViews.removeAll()
            for image in images {
                let imageView = UIImageView(image: image)
                imageView.contentMode = .scaleAspectFit
                imageView.translatesAutoresizingMaskIntoConstraints = false
                addSubview(imageView)
                imageViews.append(imageView)
            }
            setNeedsLayout()
        }
    }

    var imageViews: [UIImageView] = []

    override func layoutSubviews() {
        super.layoutSubviews()
        for (index, imageView) in imageViews.enumerated() {
            imageView.frame = bounds
            imageView.frame.size.width = bounds.width
            imageView.frame.size.height = bounds.height
            imageView.frame.origin.x = 0
            imageView.frame.origin.y = bounds.height * CGFloat(index)
        }
    }
}
```

You can use it like this:

```
let stackedImageView = StackedImageView()
stackedImageView.images = [UIImage(named: "image1")!, UIImage(named: "image2")!]
```

